import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import './assets/css/style.css';
import './assets/js/main';
import './assets/vendor/aos/aos.css'
import './assets/vendor/owl.carousel/assets/owl.carousel.min.css';
import './assets/vendor/venobox/venobox.css';
import './assets/vendor/boxicons/css/boxicons.min.css';
import './assets/vendor/icofont/icofont.min.css';
import './assets/vendor/bootstrap/css/bootstrap.min.css';
import 'https://fonts.googleapis.com/css?family=Open+Sans:300,300i,400,400i,600,600i,700,700i|Raleway:300,300i,400,400i,500,500i,600,600i,700,700i|Poppins:300,300i,400,400i,500,500i,600,600i,700,700i';
import './assets/vendor/aos/aos.js';
import './assets/vendor/typed.js/typed.min.js';
import './assets/vendor/owl.carousel/owl.carousel.min.js';
import './assets/vendor/venobox/venobox.min.js';
import './assets/vendor/isotope-layout/isotope.pkgd.min.js';
import './assets/vendor/counterup/counterup.min.js';
import './assets/vendor/waypoints/jquery.waypoints.min.js';
import './assets/vendor/php-email-form/validate.js';
import './assets/vendor/jquery.easing/jquery.easing.min.js';
import './assets/vendor/bootstrap/js/bootstrap.bundle.min.js';
import './assets/vendor/jquery/jquery.min.js'

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
